import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import authService from '../services/authService';
import '../styles/register.css';

function Register() {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    nombre: '',
    apellidos: '',
    fechaNacimiento: '',
    email: '',
    password: '',
    confirmPassword: '',
    roles: []  // Array para los roles seleccionados
  });

  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  // Manejo de inputs de texto
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // Manejo de checkboxes para roles
  const handleCheckboxChange = (e) => {
    const { value, checked } = e.target;
    let newRoles = [...formData.roles];
    if (checked) {
      if (!newRoles.includes(value)) {
        newRoles.push(value);
      }
    } else {
      newRoles = newRoles.filter(role => role !== value);
    }
    setFormData({ ...formData, roles: newRoles });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (formData.password !== formData.confirmPassword) {
      setError('Las contraseñas no coinciden');
      return;
    }
    try {
      await authService.register(formData);
      setSuccess('Registro exitoso, ya puedes iniciar sesión.');
      setTimeout(() => {
        navigate('/');
      }, 2000);
    } catch (err) {
      setError('Error en el registro. Inténtalo de nuevo.');
    }
  };

  return (
    <div className="register-container">
      <form onSubmit={handleSubmit} className="register-form">
        <h2 className="form-title">Crear Cuenta</h2>
        {error && <p className="error">{error}</p>}
        {success && <p className="success">{success}</p>}

        <div className="input-wrapper">
          <label htmlFor="nombre">Nombre:</label>
          <input
            type="text"
            name="nombre"
            id="nombre"
            placeholder="Tu nombre"
            value={formData.nombre}
            onChange={handleChange}
            required
          />
        </div>

        <div className="input-wrapper">
          <label htmlFor="apellidos">Apellidos:</label>
          <input
            type="text"
            name="apellidos"
            id="apellidos"
            placeholder="Tus apellidos"
            value={formData.apellidos}
            onChange={handleChange}
            required
          />
        </div>

        <div className="input-wrapper">
          <label htmlFor="fechaNacimiento">Fecha de Nacimiento:</label>
          <input
            type="date"
            name="fechaNacimiento"
            id="fechaNacimiento"
            value={formData.fechaNacimiento}
            onChange={handleChange}
            required
          />
        </div>

        <div className="input-wrapper">
          <label htmlFor="email">Email:</label>
          <input
            type="email"
            name="email"
            id="email"
            placeholder="example@gmail.com"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </div>

        <div className="input-wrapper">
          <label htmlFor="password">Contraseña:</label>
          <input
            type="password"
            name="password"
            id="password"
            placeholder="********"
            value={formData.password}
            onChange={handleChange}
            required
          />
        </div>

        <div className="input-wrapper">
          <label htmlFor="confirmPassword">Confirmar Contraseña:</label>
          <input
            type="password"
            name="confirmPassword"
            id="confirmPassword"
            placeholder="********"
            value={formData.confirmPassword}
            onChange={handleChange}
            required
          />
        </div>

        {/* Selección de roles */}
        <div className="input-wrapper roles-wrapper">
          <label>Selecciona tu(s) rol(es):</label>
          <div className="checkbox-group">
            <label>
              <input
                type="checkbox"
                name="roles"
                value="Padre"
                onChange={handleCheckboxChange}
              />
              Padre
            </label>
            <label>
              <input
                type="checkbox"
                name="roles"
                value="Tutor"
                onChange={handleCheckboxChange}
              />
              Tutor
            </label>
            <label>
              <input
                type="checkbox"
                name="roles"
                value="Terapeuta"
                onChange={handleCheckboxChange}
              />
              Terapeuta
            </label>
            <label>
              <input
                type="checkbox"
                name="roles"
                value="Paciente"
                onChange={handleCheckboxChange}
              />
              Paciente
            </label>
          </div>
        </div>

        <button type="submit" className="register-btn">Registrar</button>
      </form>
      <p className="login-link">
        ¿Ya tienes una cuenta? <a href="/">Inicia sesión</a>
      </p>
    </div>
  );
}

export default Register;
